nd a standard deviation of 503.89.\n","\n","6. max_power: Maximum power output ranges from 32.8 to 400, with an average of 91.59 and a standard deviation of 35.75.\n","\n","7. seats: The number of seats ranges from 2 to 14, with an average of 5.42 and a very low standard deviation of 0.96, indicating less variability in this variable.\n","\n","8. age: The age of cars ranges from 4 to 30 years, with an average of 10.02 years. The standard deviation is 3.86, indicating variability in the age of the cars.\n","\n","These summary statistics provide a quick overview of the central tendency, spread, and distribution of the different variables in the dataset."]},{"cell_type":"markdown","id":"1e049b25","metadata":{"papermill":{"duration":0.0167,"end_time":"2024-02-26T13:22:00.623783","exception":false,"start_time":"2024-02-26T13:22:00.607083","status":"completed"},"tags":[]},"source":["Given the variation in ranges and standard deviations among the variables, employing different binwidths for individual histograms and frequency polygons is considered good practice. For this purpose, we will adopt the Freedman-Diaconis's Rule, calculated as \n","2×IQR×n^(−1/3).\n","This strategy enables us to customize visualizations according to the distinctive features of each variable, enhancing the precision of the data representation."]},{"cell_type":"markdown","id":"c566041f","metadata":{"papermill":{"duration":0.016496,"end_time":"2024-02-26T13:22:00.656806","exception":false,"start_time":"2024-02-26T13:22:00.64031","status":"completed"},"tags":[]},"source":["for selling Price we have\n","2 * 420,000 * 7906^(-1/3) we get "]},{"cell_type":"code","execution_count":14,"id":"94c882fa","metadata":{"execution":{"iopub.execute_input":"2024-02-26T13:22:00.695402Z","iopub.status.busy":"2024-02-26T13:22:00.693471Z","iopub.status.idle":"2024-02-26T13:22:00.72558Z","shell.execute_reply":"2024-02-26T13:22:00.723044Z"},"papermill":{"duration":0.055188,"end_time":"2024-02-26T13:22:00.72915","exceptio